(54, 110652, 176, 'বিদ্যালয় বন্ধের বিজ্ঞপ্তি', 'news', 'অত্র কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়ের সকল শিক্ষার্থী, শিক্ষকবৃন্দ ও সংশ্লিষ্ট সকলের অবগতির জন্য জানান যাচ্ছে যে, পবিত্র মাহে রমজান, শবে ক্বদর, জুমাতুল বিদা উপলক্ষে বিদ্যালয়ের সকল কার্যক্রম আগামী 07/06/2016 ইং তারিখ হইতে আগামী 09/07/2016 ইং তারিখ পর্যন্ত বন্ধ থাকবে। আগামী 10/07/2016 ইং তারিখ বিদ্যালয় যথারীতি চলিবে। বিদ্যালয় খোলার দিন সকল শিক্ষার্থীকে উপস্থিত থাকার জন্য বিশেষ ভাবে বলা হল। <br>', '', NULL, '', '', '', '', 1465824995, 1),
(56, 110652, 176, 'গ্রীষ্মকালীন ছুটির বিজ্ঞপ্তি', 'Noticeboard', 'গ্রীষ্মকালীন অবকাশ, পবিত্র শবে বরাত উপলক্ষ্যে বিদ্যালয় আগামী ১৪/০৫/২০১৬ ইং তারিখ হইতে ২৬/০৫/২০১৬ ইং তারিখ পর্যন্ত বিদ্যালয় বন্ধ থাকিবে। আগামী ২৮/০৫/২০১৬ ইং তারিখ হইতে বিদ্যালয় যথারীতি চলিবে। <br><br><div style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; মোঃ সোহরাফ হোসেন<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; প্রধান শিক্ষক<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp