(66, 110652, 176, 'JSC (জুনিয়র স্কুল সার্টিফিকেট পরীক্ষা) বিজ্ঞপ্তি', 'news', '<div data-contents=\"true\"><div data-offset-key=\"b1259-0-0\" data-editor=\"30ed9\" data-block=\"true\" class=\"\"><div class=\"_1mf _1mj\" data-offset-key=\"b1259-0-0\"><span data-offset-key=\"b1259-0-0\"><span data-text=\"true\">এতদ্বারা অত্র প্রতিষ্ঠানের অষ্টম শ্রেণিতে অধ্যয়নরত শিক্ষার্থীদের অবগতির জন্য জানানো যাচ্ছে যে, তাদের জুনিয়র স্কুল সার্টিফিকেট পরীক্ষার ফরম পূরণ আগামী 20/07/2016 ইং তারিখ শুরু হতে যাচ্ছে। তাই শ্রেণি শিক্ষকের সাথে যোগাযোগ করে 20 তারিখের পূর্বেই ফরম পূরণ নিশ্চিত করার জন্য বিশেষ ভাবে বলা হল। বিস্তারিত জানতে <br><br> </span></span></div></div><div data-offset-key=\"1vc2j-0-0\" data-editor=\"30ed9\" data-block=\"true\" class=\"\"><div class=\"_1mf _1mj\" data-offset-key=\"1vc2j-0-0\"><span data-offset-key=\"1vc2j-0-0\"><span data-text=\"true\"><br><br></span></span></div></div><div data-offset-key=\"d5rn8-0-0\" data-editor=\"30ed9\" data-block=\"true\" class=\"\"><div class=\"_1mf _1mj\" data-offset-key=\"d5rn8-0-0\"><span data-offset-key=\"d5rn8-0-0\"><span data-text=\"true\"><br></span></span></div></div><div data-offset-key=\"9rtnb-0-0\" data-editor=\"30ed9\" data-block=\"true\" class=\"\"><div class=\"_1mf _1mj\" data-offset-key=\"9rtnb-0-0\"><span data-offset-key=\"9rtnb-0-0\"><span data-text=\"true\">মোবাইল: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; প্রধান শিক্ষক- 01712269834 / <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ইমাম হোসেন রাসেল- 01985756117</span></span></div></div></div>', '', NULL, '', '', '', '', 1468292372, 1),
(69, 110652, 176, 'জাতীয় শোক দিবস পালন সংক্রান্ত', 'notice', 'এত দ্বারা কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়ের সকল শিক্ষার্থী, শিক্ষক এবং সংশ্লিষ্ট সকলের অবগতির জন্য জানানো যাইতেছে যে, আগামীকাল ১৫ ই আগষ্ট মহান নেতা জাতির পিতা বঙ্গবন্ধু শেখ মুজিবুর রহমান ও তার পরিবার বর্গের ৪১ তম শাহাদাত বার্ষিকী উপলক্ষ্যে জাতীয় শোক দিবস। জাতীয় শোক দিবস যথাযোগ্য মর্যাদায় পালনের উদ্দেশ্যে অত্র প্রতিষ্ঠানে নিন্মোক্ত কর্মসূচী আয়োজন করা হয়েছে। <br>১. সকাল ৬ ঘটিকায় জাতীয় পতাকা অর্ধনমিত রাখা।<br>২. সকাল ৯ ঘটিকায় বঙ্গবন্ধুর প্রতিকৃতিতে পুষ্পস্তবক অর্জণ। <br>৩. দোয়া মাহফিল<br>৪. রচনা প্রতিযোগীতা<br>৫. আলোচনা অনুষ্ঠান<br>৬. প্রামাণ্য চিত্র প্রদর্শন।<br><br>অতএব সকল শিক্ষার্থী, শিক্ষক এবং সংশ্লিষ্ট সকলকে যথাযসময়ে বিদ্যালয়ের প্রাঙ্গণে উপস্থিত হতে বিশেষ তাগাদা দেয়া হল। <br><br>মো: সোহরাফ হোসেন<br>প্রধান শিক্ষক<br>কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়<br>কালকিনি, মাদারীপুর।', '', NULL, '', '', '', '', 1471146417, 1),
(70, 110652, 176, 'J.S.C (জুনিয়র স্কুল সার্টিফিকেট পরীক্ষা) পরীক্ষা- ২০১৬ ইং এর রুটি', 'Notice Board', '<br>', '20160823143302487088(1).jpg', NULL, '', '', '', '', 1472351059, 1),
(71, 110652, 176, 'দাতা সদস্য এর বিজ্ঞপ্তি', 'দাতা সদস্য এর বিজ্ঞপ্তি', ' এতদ্বারা অত্র এলাকার সকলের অবগতির জন্য জানানো যাচ্ছে যে কালিনগর ফাসিয়াতলা উচ্চ বিদ্যলয়ের ম্যানেজিং কমিটির মেয়াদ আগামী ২৪/০৫/২০১৬ ইং তারিখে উত্তীর্ণ হবে। বিধি অনুযায়ি আগামী ম্যনেজিং কমিটির দাতা সদস্য হিসাবে নির্বাচনের লক্ষে এককালীন ২০০০০০/- (দুই লক্ষ) টাকা প্রতিষ্ঠানের সাধারন তহবিল সঞ্চয়ী হিসাব নম্বর: ১১৩/১ জনতা ব্যাংক লিঃ কালকিনি শাখায় জমা করে রশিদ সহ  আগামী ২২/০৯/২০১৬ ইংতারিখের মধ্যে প্রধান শিক্ষকের নিকট পৌছানোর জন্য অনুরোধ করা গেল।<div><br></div><div style=\"text-align: center;\">&nbsp;ধন্যবাদান্তে&nbsp;</div><div style=\"text-align: center;\">মোঃ সোহরাফ হোসেন</div><div style=\"text-align: center;\">&nbsp;প্রধান শিক্ষক&nbsp;</div><div style=\"text-align: center;\">কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়</div><div style=\"text-align: center;\">&nbsp;কালকিনি মাদারীপুর।</div>', '', NULL, '', '', '', '', 1477286086, 1);
INSERT INTO `settings` (`SettingsId`, `InstituteName`, `InstituteSlogan`, `InstituteEstablished`, `InstituteEIIN`, `InstituteIsMPO`, `InstituteLogo`, `InstituteHeader`, `InstitutePhone`, `InstituteEmail`, `InstituteAddress`, `InstituteWebsite`, `InstituteKeywords`, `InstituteTime`, `InstituteGoogleMaps`, `ShortInformation`, `AdminName`, `AdminPhone`, `AdminEmail`, `AdminPhoto`, `AdminSign`, `AdminMessage`, `AdminMessagePhoto`, `SelectedTheme`, `InstituteName_en`, `InstituteEIIN_en`, `InstituteAddress_en`) VALUES
(1, 'কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয় ', 'জ্ঞান মানুষের অন্তরকে আলোকিত করে', '১৯৫১ ইং', ' ১১০৬৫২', '', 'Untitled-22.png', '', '০১৭১২২৬৯৮৩৪', 'info@kalinagarfasiatalahighschool.edu.bd', ' কালিনগর, ফাসিয়াতলা,কালকিনি,  মাদারীপুর', 'http://www.kalinagarfasiatalahighschool.edu.bd/', 'কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয় ,http://www.tritiyo.com', '9:00AM to 4:00 PM', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'মাদারীপুর জেলার কালকিনি উপজেলাধীন আলীনগর ইউনিয়নে কালিনগর গ্রামে অবস্থিত কারিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়।বিদ্যালয়টি ১৯৫১ ইং সালে প্রতিষ্ঠিত হয়ে অদ্য পর্যন্ত অত্র কালিনগর গ্রাম তথা আলীনগর, এনায়েতনগর ইউনিয়নের জণসাধারনের নিকট একটি আদর্শ শিক্ষা প্রতিষ্ঠান হিসেবে পরিগণিত হয়ে আসছে। এই বিদ্যালয়টি প্রতিষ্ঠার পিছনে যাদের অবদান অনস্বীকার্য তাদের আমরা বিদ্যালয়ের পক্ষ থেকে জানাই বিনম্র শ্রদ্ধা ও সহস্র সালাম। তারা অত্র এলাকার কোমলমতি শিশুদের শিক্ষার প্রয়োজনীয়তা অনুভব করেই শিক্ষানুরাগী হিসেবে কেউ জমি দিয়ে, কেউ দৈহিক পরিশ্রম দিয়ে, কেউ মেধা দিয়ে প্রতিষ্ঠিত করেছে আজকের এই কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়টি। আমাদের বিদ্যালয়ে রয়েছে একঝাক তরুন শিক্ষকমন্ডলী যাদের অক্লান্ত পরিশ্রম আর মেধার পাঠদানের ভিত্তিতে বিদ্যালয়টি পাবলিক পরীক্ষার ফলাফলে অত্যন্ত সন্তোষজনক অবস্থানে রয়েছে।২০১৪, ২০১৫ জে, এস, সি ও এস, এস, সি পরীক্ষায় শতভাগ পাশ সহ মাদারীপুর জেলায় ৪র্থ ও কালকিনি উপজেলায় প্রথম স্থান অধিকার করেছে।', 'মো: সোহরাফ  হোসেন ', '০১৭১২২৬৯৮৩৪', 'kfhs110652@hotmail.com', 'Hm.jpg', 'Hm.jpg', '<div style=\"text-align: justify;\">মাদারীপুর জেলার কালকিনি উপজেলাধীন আলীনগর ইউনিয়নে কালিনগর গ্রামে অবস্থিত কারিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়।বিদ্যালয়টি ১৯৫১ ইং সালে প্রতিষ্ঠিত হয়ে অদ্য পর্যন্ত অত্র কালিনগর গ্রাম তথা আলীনগর, এনায়েতনগর ইউনিয়নের জণসাধারনের নিকট একটি আদর্শ শিক্ষা প্রতিষ্ঠান হিসেবে পরিগণিত হয়ে আসছে। এই বিদ্যালয়টি প্রতিষ্ঠার পিছনে যাদের অবদান অনস্বীকার্য তাদের আমরা বিদ্যালয়ের পক্ষ থেকে জানাই বিনম্র শ্রদ্ধা ও সহস্র সালাম। তারা অত্র এলাকার কোমলমতি শিশুদের শিক্ষার প্রয়োজনীয়তা অনুভব করেই শিক্ষানুরাগী হিসেবে কেউ জমি দিয়ে, কেউ দৈহিক পরিশ্রম দিয়ে, কেউ মেধা দিয়ে প্রতিষ্ঠিত করেছে আজকের এই কালিনগর ফাসিয়াতলা উচ্চ বিদ্যালয়টি। আমাদের বিদ্যালয়ে রয়েছে একঝাক তরুন শিক্ষকমন্ডলী যাদের অক্লান্ত পরিশ্রম আর মেধার পাঠদানের ভিত্তিতে বিদ্যালয়টি পাবলিক পরীক্ষার ফলাফলে অত্যন্ত সন্তোষজনক অবস্থানে রয়েছে।২০১৪, ২০১৫ জে, এস, সি ও এস, এস, সি পরীক্ষায় শতভাগ পাশ সহ মাদারীপুর জেলায় ৪র্থ ও কালকিনি উপজেলায় প্রথম স্থান অধিকার করেছে।</div>', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
